import React from 'react';
import{ Container,Breadcrumb,Row, Col} from "react-bootstrap";

function App(){
  return(
    <Container>
    <Row>
      <Col>
        <Breadcrumb>
          <Breadcrumb.Item href="https://react-bootstrap.github.io">
            <h5>Website React Bootstrap</h5>
          </Breadcrumb.Item>
        </Breadcrumb>
      </Col>
      <Col xs={6}></Col>
      <Col>
      </Col>
    </Row>

    </Container>
  );
}

export default App;
